import React  from "react"

const Table = (props) => {
    const title  = props.tableName;
    const data   = props.details[title];
    return (
    <>
        <table>
            <tr>
                <th> # </th>
                {
                    ["Company", 
                    "Designation", 
                    "StartDate", 
                    "EndDate"].map(values => <th> {values}</th>)
                }
            </tr>
            {
                data.map((row, pos) => 
                    <tr>
                        <td> {pos}</td>
                        <td>{row.Company}</td>
                        <td>{row.Designation}</td>
                        <td>{row.EndDate}</td>
                    </tr>
                )
            }
        </table>
    </>
    )

} 

export default Table;
